$(document).ready(function() {
    $('body').prepend("<div class='appBox' style='min-width:400px;min-height:400px;display:none;width:calc(100%-50px);height:calc(100%-50px);position:absolute;top:50px;left:50px;bottom:50px;right:50px;background-color:rgba(0,0,0,0.75);border-radius:10px;padding:10px;'><a href='#' onclick='closeAppBox();' style='display:inline-block;position:absolute;top:10px;right:10px;border-top-right-radius:5px;border-bottom-left-radius:5px;text-align:center;background-color:red;color:white;text-decoration:none;width:25px;height:25px;'>X</a></div>");
    $('body').prepend("<div class='appBoxBG' style='position:absolute;width:100%;height:100%;top:0;left:0;background-color:rgb(75,75,75);display:none;'><a href='#' style='display:inline-block;width:100%;height:100%;cursor:default;' onclick='closeAppBox()'></a></div>")
});

function appBox(location, resizeImage, useIFrame) {
    if (location) {
        if (useIFrame == 1) {
            $('.appBox').append('<iframe class="appBoxContents" width="100%" height="100%" style="margin-left:auto;margin-right:auto;border-radius:5px;background-color:#262626" frameborder="0" src="' + location + '"></iframe>');
        } else {
            $('body').prepend('<image src="'+location+'" class="imageTest" style="display:none;"></image>');
            if (resizeImage == 1) {
                $('.appBox').append('<image class="appBoxContents" width="100%" height="100%" style="border-radius:5px;" src="' + location + '"></image>');
            } else {
                $('.appBox').append('<image class="appBoxContents" style="border-radius:5px;" src="' + location + '"></image>');
            }
        }
        $('body').css('overflow', 'hidden');
        $('body').prepend("<div class='appBoxLoad' style='display:none;position:absolute;left:50%;top:50%;width:38px;height:38px;background-image:url(data:image/gif;base64,)'></div>");
        $('.appBoxLoad').fadeIn(200);
        $('.appBoxContents').load(function () {
            $('.appBox').fadeIn(function () {
                $('.appBoxLoad').remove();
            });
            $('.appBoxBG').fadeTo(0.75);
        });
    }
}

function closeAppBox() {
    $('.appBox').fadeOut();
    $('.appBoxBG').fadeOut(function(){$('.appBoxContents').remove();$('body').css('overflow', 'auto');});
    $('.imageTest').remove();
}
